## MPACMF
def MPACMF(A,B,IQ):
    "!     IQ=\
     !     1  C=A*B\
     !     2  C=A(TRANSPOSE)*B\
     !     3  C=A*B(TRANSPOSE)"
    # 1: A(L,M),B(M,N),C(L,N)
    #
    #
    #
    #
    A = np.matrix(A)
    B = np.matrix(B)
    if IQ == 1:
        A = A.transpose()
        B = B.transpose()
        C = A * B
        C = C.transpose()
    if IQ == 2:
        B = B.transpose()
        C = A * B
        C = C.transpose()
    if IQ == 3:
        A = A.transpose()
        C = A * B
        C = C.transpose()
    return C

