## MMpyMF
def MMpyMF(A,B):
    # A - (L,M) fortran
    # B - (M,N) fortran
    # C - (L,N) fortran
    # A = matrix( [1,2,3, ...,L],
    #             [2,...
    #             [3,...
    #             [4,...
    #             [.
    #             [M


    # B = matrix( [1,2,3, ...,M],
    #             [2,...
    #             [3,...
    #             [4,...
    #             [.
    #             [N

    # C = matrix( [1,2,3, ...,L],
    #             [2,...
    #             [3,...
    #             [4,...
    #             [.
    #             [N




    A = np.matrix(A)
    B = np.matrix(B)
    A = A.transpose()
    B = B.transpose()
    C = A * B
    C = C.transpose()

    return C

