## MatMP1
def MatMp1(A,B):
    "Interface MatMp1 subroutine into Python"
    # A - (M,L) fortran
    #    A[L][M]
    # B - (M,N) fortran
    #    B[N][M]
    # Product - (L,N) fortran
    #          C[N][L]
    #
    #   = matrix( [1,2,3, ...,M],
    #             [2,...
    #             [3,...
    #             [4,...
    #             [.
    #             [L


    #   = matrix( [1,2,3, ...,M],
    #             [2,...
    #             [3,...
    #             [4,...
    #             [.
    #             [N

    #   = matrix( [1,2,3, ...,L],
    #             [2,...
    #             [3,...
    #             [4,...
    #             [.
    #             [N

    A = np.array( A )
    B = np.array( B )
    #B = B.transpose()
    #print A
    #print B
    L = len(A)
    N = len(B)
    M = len(A[0])

    C=[]
    for i in range(N):
        C.append( [] )
    for i in range(N):
        for j in range(L):
            C[i].append(0)

    for i in range(N):
        for j in range(L):
            C[i][j] = np.dot( A[j], B[i] )
    C = np.array(C)

    return C
