## pDiagSq
def pDiagSq(Indx,B):
    "!---  General inverse enhanced version of DiagSqrt.\
     !---  A is a diagonal matrix with diagonal terms\
     !---  Indx = 0, sqrt(B)\
     !---      ne 0, sqrt(B)**-1 if B(i) > 0.\
     !---  It's assumed that B(i) .ge. 0. It doesn't work if there are\
     !---  negative elements in B, which is not checked."
    B = np.array(B)
    N = len(B)
    A = np.zeros((N,N))
    eps = 1.0e-8
    if Indx == 0:
        for i in range(N):
            A[i,i] = (abs(B[i]))**0.5
    else:
        for i in range(N):
            if (abs(B[i]) > eps):
                A[i,i] = 1 / (abs(B[i]))**0.5

    return A
