## SqrtMp
def SqrtMp(Mode,S):
    "!---  Calculate square-root matrix X=S^1/2 and/or its (general) inverse\
     !---  Xi. Here S must be a SYMMETRIC matrix.\
     !---  Mode > 0: Calculate X\
     !---       < 0: Calculate Xi"

    S = np.matrix( S )
    if Mode > 0:
        P = sqrtm( S )

    if Mode < 0:
        P = np.linalg.pinv(  sqrtm( S ) )

    return P

