## LT2Sqr
def LT2Sqr(N,T):
    "Transform a lower triangular vector into a square matrix"
    S=[]
    for i in range(N):
        S.append( [] )
    for i in range(N):
        for j in range(N):
            S[i].append(0)


    k = 0 -1 # corrected for python
    for i in range(N):
        if i == 1:
            k = k + 1
            S[i][0] = T[k]
            S[0][i] = T[k]
            #print S
        if i != 1:
            for j in range(i):
                k = k + 1
                S[i][j] = T[k]
                S[j][i] = T[k]
                #print S
        k = k + 1
        S[i][i] = T[k]
        #print S

    return S
