def AnBInA(NComp,NBas,NVec,A,O,B,FulAmp):
    pass

    # Input data
    # A has NBas lists whose length is NComp
    # O has NComp lists whose length is NComp
    # B has NVec lists whose length is NComp

    # Output data
    # Amp1 has NVec lists whose length is NBas

    Tresh = 1e-10
    LowTr = False

    # Initialize tmp1
    tmp1 = []
    for i in range(NBas):
        tmp1.append( [] )
    for i in range(NBas):
        for j in range(NComp):
            tmp1[i].append( 0 )

    # Initialize tmp2
    tmp2 = []
    for i in range(NVec):
        tmp2.append( [] )
    for i in range(NVec):
        for j in range(NComp):
            tmp2[i].append( 0 )

    # Initialize Saa
    Saa = []
    for i in range(NBas):
        Saa.append( [] )
    for i in range(NBas):
        for j in range(NBas):
            Saa[i].append( 0 )

    # Initialize Sbb
    Sbb = []
    for i in range(NVec):
        Sbb.append( [] )
    for i in range(NVec):
        for j in range(NVec):
            Sbb[i].append( 0 )

    # Initialize Sab
    Sab = []
    for i in range(NVec):
        Sab.append( [] )
    for i in range(NVec):
        for j in range(NBas):
            Sab[i].append( 0 )

    # Initialize Amp1
    Amp1 = []
    for i in range(NVec):
        Amp1.append( [] )
    for i in range(NVec):
        for j in range(NBas):
            Amp1[i].append( 0 )




    # Product between A and O
    for i in range(NBas):
        for j in range(NComp):
            tmp1[i][j] = np.dot( A[i], O[j] )

    # Product between tmp1 and A
    for i in range(NBas):
        for j in range(NBas):
            Saa[i][j] = np.dot( tmp1[i], A[j] )

    # Product between B and O
    for i in range(NVec):
        for j in range(NComp):
            tmp2[i][j] = np.dot( B[i], O[j]   )

    # Product between tmp2 and B
    for i in range(NVec):
        for j in range(NVec):
            Sbb[i][j] = np.dot( tmp2[i], B[j] )

    # Product between A and O
    for i in range(NBas):
        for j in range(NComp):
            tmp1[i][j] = np.dot( A[i], O[j] )

    # Product between tmp1 and B
    for i in range(NBas):
        for j in range(NVec):
            Sab[j][i] =  np.dot( tmp1[i], B[j] )

    #
    for Mu in range(NVec):
        for n in range(NBas):
            if FulAmp:
                Amp1[Mu][n] = Sab[Mu][n] / math.sqrt(abs( Saa[n][n] ) )
            else:
                Amp1[Mu][n] = Sab[Mu][n] * Sab[Mu][n] /( Saa[n][n]*Sbb[Mu][Mu] )


    return Amp1




# SProd2lay -> Calculate scalar product for lists with 2 layers
# A[nl1][nl2]
# B[nl1][nl2]
#
def SProd2lay(A,B):
    if len(A) != len(B):
        stop("Error: Dimension not match in A and B within SProd2lay")
    if len(A[0]) != len(B[0]):
        stop("Error: Dimension not match in A and B within SProd2lay")

    nl1 = len(A)
    nl2 = len(A[0])
    tmp0 = 0.0
    for i in range(nl1):
        tmp1 = 0.0
        if len(A[i]) != len(B[i]):
            stop("Error: Dimension not match in A and B within SProd2lay")

        for j in range(nl2):
            p = A[i][j] * B[i][j]
            tmp1 = tmp1 + p
        tmp0 = tmp0 + tmp1

    return tmp0

